import React from "react"

export default class Item extends React.Component{

    constructor(){
        super()
        this.state = {
            checked : false,
        }
    }

    render(){
        return(
            <div className = "todo-item">
                <input type="checkbox" id = {this.props.name} />
                <label for= {this.props.name}> {this.props.name}</label><br/>
                </div>
        );

    }
}
